"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[1103],{16211:(e,t,i)=>{i.r(t),i.d(t,{default:()=>a,johnChapter14PL:()=>n});const n={chapter:14,title:"Jean 14",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Niech si\u0119 nie trwo\u017cy serce wasze; wierzycie w Boga, i we mnie wierzcie.",strong:[{text:"Dieu",strong:"G2316",start:46,end:50}]},{number:2,text:"W domu Ojca mego wiele jest mieszka\u0144; a gdyby tak nie by\u0142o, by\u0142bym wam powiedzia\u0142; id\u0119, abym wam zgotowa\u0142 miejsce.",strong:[{text:"dans",strong:"H6887",start:26,end:30},{text:"maison",strong:"G3609",start:34,end:40}]},{number:3,text:"A je\u017ali odejd\u0119, i zgotuj\u0119 wam miejsce, zasi\u0119 przyjd\u0119, i przyjm\u0119 was do siebie samego, aby\u015bcie, gdzie ja jestem, i wy byli.",strong:[{text:"avec",strong:"G1848",start:107,end:111}]},{number:4,text:"A dok\u0105d ja id\u0119, wiecie, i drog\u0119 wiecie.",strong:[{text:"chemin",strong:"G3598",start:43,end:49}]},{number:5,text:"Rzek\u0142 mu Tomasz: Panie! nie wiemy, dok\u0105d idziesz, a jako\u017c mo\u017cemy wiedzie\u0107 drog\u0119?",strong:[{text:"Thomas",strong:"G2381",start:0,end:6},{text:"Seigneur",strong:"G2962",start:16,end:24},{text:"savoir",strong:"G1097",start:76,end:82},{text:"chemin",strong:"G3598",start:86,end:92}]},{number:6,text:"Rzek\u0142 mu Jezus: Jam jest droga, i prawda, i \u017cywot; \u017caden nie przyjdzie do Ojca, tylko przeze mnie.",strong:[{text:"chemin",strong:"G3598",start:26,end:32}]},{number:7,text:"By\u015bcie mi\u0119 byli znali, i Ojca mego znaliby\u015bcie; a od teraz znacie go, i widzieli\u015bcie go.",strong:[]},{number:8,text:"Rzek\u0142 mu Filip: Panie! uka\u017c nam Ojca, a dosy\u0107 nam.",strong:[{text:"Philippe",strong:"G5376",start:0,end:8},{text:"Seigneur",strong:"G2962",start:18,end:26}]},{number:9,text:"Rzek\u0142 mu Jezus: Tak dawno z wami jestem, a nie pozna\u0142e\u015b mi\u0119, Filipie? Kto mi\u0119 widzia\u0142, widzia\u0142 Ojca; a jako\u017c ty powiadasz: Uka\u017c nam Ojca?",strong:[{text:"avec",strong:"G1848",start:47,end:51},{text:"Philippe",strong:"G5376",start:83,end:91}]},{number:10,text:"Nie wierzysz\u017ce, \u017ce ja w Ojcu, a Ojciec we mnie jest? S\u0142\xf3w, kt\xf3re ja wam m\xf3wi\u0119, nie m\xf3wi\u0119 sam od siebie; ale Ojciec, kt\xf3ry we mnie mieszka, on czyni te sprawy.",strong:[{text:"dans",strong:"H6887",start:28,end:32},{text:"demeure",strong:"H1004",start:144,end:151}]},{number:11,text:"Wierzcie mi, \u017ce ja w Ojcu, a Ojciec we mnie; je\u017ali nie, dla tych samych spraw wierzcie mi.",strong:[{text:"dans",strong:"H6887",start:20,end:24}]},{number:12,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Kto wierzy we mnie, sprawy, kt\xf3re ja czyni\u0119, i on czyni\u0107 b\u0119dzie, i wi\u0119ksze nad te czyni\u0107 b\u0119dzie; bo ja id\u0119 do Ojca mego.",strong:[]},{number:13,text:"A czegokolwiek by\u015bcie prosili w imieniu mojem, to uczyni\u0119, aby by\u0142 uwielbion Ojciec w Synu.",strong:[{text:"tout",strong:"G3956",start:3,end:7},{text:"dans",strong:"H6887",start:87,end:91},{text:"Fils",strong:"G5207",start:95,end:99}]},{number:14,text:"Je\u017ali czego prosi\u0107 b\u0119dziecie w imieniu mojem, ja to uczyni\u0119.",strong:[]},{number:15,text:"Je\u017ali mi\u0119 mi\u0142ujecie, przykaza\u0144 moich strze\u017ccie.",strong:[]},{number:16,text:"A ja b\u0119d\u0119 prosi\u0142 Ojca, i inszego Pocieszyciela da wam, aby z wami by\u0142 na wieki;",strong:[{text:"demeure",strong:"H1004",start:80,end:87},{text:"avec",strong:"G1848",start:102,end:106}]},{number:17,text:"Ducha prawdy, kt\xf3rego \u015bwiat nie mo\u017ce przyj\u0105\u0107; bo go nie widzi, ani go zna; ale wy go znacie, \u017ce u was mieszka, i w was b\u0119dzie.",strong:[{text:"Esprit",strong:"G4151",start:2,end:8},{text:"monde",strong:"G2889",start:27,end:32},{text:"recevoir",strong:"G3880",start:41,end:49},{text:"demeure",strong:"H1004",start:142,end:149},{text:"avec",strong:"G1848",start:150,end:154}]},{number:18,text:"Nie zostawi\u0119 was sierotami; przyjd\u0119 do was.",strong:[]},{number:19,text:"Jeszcze maluczko, a \u015bwiat mi\u0119 wi\u0119cej nie obaczy; ale wy mi\u0119 ogl\u0105da\u0107 b\u0119dziecie; bo ja \u017cyj\u0119, i wy \u017cy\u0107 b\u0119dziecie.",strong:[{text:"monde",strong:"G2889",start:30,end:35}]},{number:20,text:"W on dzie\u0144 poznacie wy, \u017ce ja w Ojcu moim, a wy we mnie, i ja w was.",strong:[{text:"jour",strong:"H3117",start:6,end:10}]},{number:21,text:"Kto ma przykazania moje, a strze\u017ce ich, ten jest, kt\xf3ry mi\u0119 mi\u0142uje; a kto mi\u0119 mi\u0142uje, b\u0119dzie umi\u0142owany od Ojca mego, i ja go b\u0119d\u0119 mi\u0142owa\u0142, i objawi\u0119 mu si\u0119 samego.",strong:[]},{number:22,text:"Rzek\u0142 mu Judasz, (nie on Iskaryjotczyk:) Panie! c\xf3\u017c si\u0119 sta\u0142o, \u017ce si\u0119 nam masz objawi\u0107, a nie \u015bwiatu?",strong:[{text:"Seigneur",strong:"G2962",start:35,end:43},{text:"monde",strong:"G2889",start:100,end:105}]},{number:23,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 mu: Je\u017ali mi\u0119 kto mi\u0142uje, s\u0142owa mego strzedz b\u0119dzie, a Ojciec m\xf3j umi\u0142uje go, i do niego przyjdziemy, i u niego mieszkanie uczynimy.",strong:[{text:"parole",strong:"G3056",start:55,end:61},{text:"demeure",strong:"H1004",start:128,end:135}]},{number:24,text:"Kto mi\u0119 nie mi\u0142uje, s\u0142\xf3w moich nie strze\u017ce; a s\u0142owo, kt\xf3re s\u0142yszycie, nie jest moje, ale Ojca, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[{text:"parole",strong:"G3056",start:58,end:64}]},{number:25,text:"To wam m\xf3wi\u0142em u was b\u0119d\u0105c.",strong:[{text:"demeure",strong:"H1004",start:41,end:48},{text:"avec",strong:"G1848",start:49,end:53}]},{number:26,text:"Ale Pocieszyciel, Duch \u015awi\u0119ty, kt\xf3rego po\u015ble Ojciec w imieniu mojem, on was nauczy wszystkiego, i wspomni wam na wszystko, com wam m\xf3wi\u0142.",strong:[{text:"Esprit",strong:"G4151",start:23,end:29},{text:"tout",strong:"G3956",start:119,end:123}]},{number:27,text:"Pok\xf3j zostawuj\u0119 wam, pok\xf3j m\xf3j daj\u0119 wam; nie jako \u015bwiat daje, ja wam daj\u0119. Niech si\u0119 nie trwo\u017cy serce wasze, ani si\u0119 l\u0119ka.",strong:[{text:"paix",strong:"G1515",start:18,end:22},{text:"paix",strong:"G1515",start:41,end:45},{text:"comme",strong:"G2531",start:68,end:73},{text:"monde",strong:"G2889",start:77,end:82}]},{number:28,text:"S\u0142yszeli\u015bcie, \u017cem wam powiedzia\u0142: Id\u0119, i przyjd\u0119 do was. By\u015bcie mi\u0119 mi\u0142owali, radowaliby\u015bcie si\u0119, \u017ce id\u0119 do Ojca; bo Ojciec wi\u0119kszy jest ni\u017c ja.",strong:[{text:"grand",strong:"G3173",start:164,end:169}]},{number:29,text:"A teraz powiedzia\u0142em wam, pierwej ni\u017c si\u0119 sta\u0142o, aby\u015bcie, gdy si\u0119 stanie, uwierzyli.",strong:[]},{number:30,text:"Ju\u017c nie b\u0119d\u0119 wiele m\xf3wi\u0142 z wami; bo idzie ksi\u0105\u017c\u0119 tego \u015bwiata, a we mnie nie ma nic.",strong:[{text:"avec",strong:"G1848",start:26,end:30},{text:"monde",strong:"G2889",start:54,end:59},{text:"rien",strong:"G3762",start:74,end:78}]},{number:31,text:"Ale aby pozna\u0142 \u015bwiat, \u017ce mi\u0142uj\u0119 Ojca, i jako mi rozkaza\u0142 Ojciec, tak czyni\u0119. Wsta\u0144cie, p\xf3jd\u017amy st\u0105d.",strong:[{text:"monde",strong:"G2889",start:17,end:22},{text:"selon",strong:"G2531",start:63,end:68},{text:"ordre",strong:"G1785",start:71,end:76}]}]},a=n}}]);
